import React from "react";
import notes from "../notes";

function createNote(props) {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
}

function Note(props) {
  return (
    <div>
      {notes.map((note) => {
        return (
          <createNote key={note.id} title={note.title} content={note.content} />
        );
      })}
    </div>
  );
}

export default Note;
